class Welcome extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      name: props.name
    }
  }

  setData(){
    localStorage.setItem("useName",JSON.stringify(this.state.name)); 
  }

  getData(){
    let data = localStorage.getItem("userName"); 
    data = JSON.parse(data); 
    console.log(data); 
  }

  render() {
    return (
      <div>
        <div className='box'>
          <form action="">
            <span className="text-center">Welcome to Valgrind</span>
            <div className="input-container">
              <input type="email" required="required" placeholder="User@gmail.com" href='/UserProfile' value={this.state.name} />
              <label>User:
          </label>
            </div>
            <div className="input-container">
              <input type="password" placeholder="************" />
              <label>Password:</label>
            </div>
            <ButtonGroup aria-label="Toolbar">
              {/* <Button variant="default me-md-2" className="btn" href='#/Portal'>Ingresar</Button>{''} */}
              <Button variant="default me-md-2" className="btn" onClick={()=> this.setData()}>Ingresar</Button>{''}
              {/* <Button variant="default me-md-2" className="btn" href='#/Register'>Registrar</Button>{''} */}
              <Button variant="default me=md-2" className="btn" onClick={()=> this.getData()}> getData </Button> 
            </ButtonGroup>
          </form>
        </div>
      </div>
    );
  }
}
export default Welcome;
